package ru.iedev.taskmanager.model.leetcode.isAnagram;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.*;

class SolutionTest {

    @Test
    void isAnagram() {

        Assertions.assertEquals(new Solution().isAnagram("anagram","nagaram"),true);

    }

    @Test
    void isAnagram1() {

        Assertions.assertEquals(new Solution().isAnagram("rat","car"),false);

    }

    @Test
    void isAnagram2() {

        Assertions.assertEquals(new Solution().isAnagram("",
                ""),
                true);

    }
}